import axios from "axios"
const { REACT_APP_BASE_URL } = process.env;
export const ProfileOne = (user) => {
    return new Promise((resolve, reject) => {
        var data = {
            full_name: "John Doe",
            first_name: "string",
            last_name: "string",
            date_of_birth: "2021-05-09T01:52:07.372Z",
            profile_name: "jogn doe",
            mobile_number: "8787878787"
        }
        headers = {
            Cookie: "session=eyJhbGciOiJSUzI1NiIsImtpZCI6InRCME0yQSJ9..gVw9h2YhwwQ9Uv3N-jaCgFG6ZadpeLGm_9bNmYYo38QeuDnzCzK5b3SJ8l9xOsW0UqAT__Rn-WNgO18U3oxJPLfWZMuH7mLryxhR96bpdGI7G9drOjPnU5XWofUdbuynS0dD6ZllN3srMt0ismiIAu_H-CFg12MWgGfw5B04baWwXqWWx_w9lzTYUCNpaiqg9iR9KEpGaektIohhLHW1ZsEZJvF-rtCtEnle6YTEgBkhDqZiAhHOIjydkVs4UbPdClzE5c4KWoPPuoCPg3wqDjxX9vNZLcAyyRyjsyuV8B7rFspGhZK83NOccWEP1knEP5UiGz1CAVEdBZo4OxGUBg;"
        } 
        axios.post("https://designmocha-dev.el.r.appspot.com/public/profile/", data, {headers: headers})
            .then((res) => {
                resolve(res)
            })
            .catch((error) => {
                reject(error)
            })
    })
}
